    const [user,setUser] = useState(firebase.auth().currentUser)

    useEffect(()=>{
        setUser(firebase.auth().currentUser)
    })

    return (
        <div>
            {user?<div className="wrapper" >
        <div className="videopage_wrapper"></div>
        <Comments />
    </div>:<div></div>}
        </div>
    )
}

export default Video;
